import 'dart:convert';

import 'package:flutter/cupertino.dart';
import 'package:flutter/material.dart';
import 'package:http/http.dart' as http;
import 'package:image_picker/image_picker.dart';
import 'package:zzzmart/auth/model/user_model.dart';
import 'package:zzzmart/res/colors.dart';
import 'package:zzzmart/res/global_data.dart';

class RegisterUtil {
  static var picker = ImagePicker();

  static var userModelList = new List<UserModel>();
  static var status = "false";

  static registrationUser(
      name, image, email, phone, gender, password, address, context) async {
    print("LL_____________________$email ___ $password ___$context");
    Map payload = {
      "cust_name": name,
      "cust_image": image,
      "cust_email": email,
      "cust_phone": phone,
      "cust_gender": gender,
      "cust_password": password,
      "cust_address": address
    };

    print("wwwwwwwwwwwww $payload");

    String url = "${GlobalData.baseUrl}${GlobalData.registerUrl}";

    var response = await http.post(
      Uri.parse(url),
      headers: {
        "Accept": "application/json",
        "Content-Type": "application/x-www-form-urlencoded"
      },
      body: payload,
      encoding: Encoding.getByName("utf-8"),
    );
    print("Response User_______${response.statusCode}");
    if (response.statusCode == 200) {
      var data;
      try {
        data = jsonDecode(response.body);
        print("All User Data_______$data");
        userModelList.clear();
        if (data['status'] == "true") {
          if (data['data'] == "true") {
            status = "true";
            GlobalData.showInSnackBar(
                "Successfully Registered!",
                context,
                MyColors.yellow,
                Colors.white,
                CupertinoIcons.checkmark_seal_fill,
                Colors.white);
          } else {
            status = "false";
            GlobalData.showInSnackBar("${data['message']}", context, Colors.red,
                Colors.white, CupertinoIcons.info_circle_fill, Colors.white);
          }
          print("All Top Stores Model_______$userModelList");
        } else {
          print("DATA_______$data");
          GlobalData.showInSnackBar("${data['message']}", context, Colors.red,
              Colors.white, CupertinoIcons.info_circle_fill, Colors.white);
          status = "false";
        }
      } catch (e) {
        status = "false";
        GlobalData.showInSnackBar("${data['message']}", context, Colors.red,
            Colors.white, CupertinoIcons.info_circle_fill, Colors.white);
        print("Exception I Store_______$e");
      }
    } else {
      userModelList.clear();
      GlobalData.showInSnackBar("Internal Server Error!", context, Colors.red,
          Colors.white, CupertinoIcons.info_circle_fill, Colors.white);
      status = "false";
    }
    return status;
  }

  static String image =
      "";
}
